import React, { Component } from "react";

class Class extends Component {
  myMethod(name) {
    return name;
  }
  render() {
    let theMethod = this.myMethod("Abdulmalik");
    return <h1>{`${theMethod} ${this.props.lName}`}</h1>;
  }
}

export default Class;
